import React from "react";

const Resultado =({dato})=>
{
    return(
<>
            <h1>
                {dato.nombres}
                {dato.apellidos}
                {dato.sexo}
                {dato.dui}
                {dato.fechaNacimiento}
                {dato.direccion}
                {dato.municipio}
                {dato.departamento}
            </h1>
</>
    );

}

export default Resultado
